RU:
О: Когда ваш уровень станет достаточно высоким для выращивания индиго и прочих растений, вы сможете найти их следующим образом:

1) прикоснитесь к пустому участку поля — откроется меню растений;
2) прикоснитесь к маленькой кнопке переключения (с двумя стрелками) в нижнем левом углу меню растений;
3) высадите семена необходимого растения, перетянув его на поле.
Для доступа к основным растениям, таким как пшеница, морковь и т. д., прикоснитесь к кнопке переключения снова.
